import React from 'react'
import { Button } from 'reactstrap'

const DisplaySpecs = (props) => {
    return (
        <Button
        hello='hello'
        href='/viewSpecs'
        color='dark'
        style={{marginBottom: '1rem'}}
        >View Full Specification</Button>
    )
}

export default DisplaySpecs
